LogicalInterface:BMW.CHASSIS.STEERING.ElectricPowerSteering[internal]@Fahren;
Mittels Aufsetzalgorithmus ermittelter Offset des aktuellen Nullpunktes der EPS-Position (entspricht der Segmentmitte des Segments in dem sich der EPS-Rotor z.B. nach dem letzten Einbruch der Spannungsversorgung befand) zum absoluten Nullpunkt (Segmentmitte des Segments bei Geradeausfahrt).
Der Offset wird angegeben als Anzahl voller Umdrehungen des EPS-Rotors (entspr. Anzahl Segmente).

LogicalInterface:BMW.INFRASTRUCTURE.DIAGNOSIS.OnBoardDiagnosis[internal]@Infrastruktur;
Alle Diagnose Status eines Steuergeräts werden in einer Botschaft zusammengefasst. Falls mehr als 8 Diagnose Status vorhanden sind, werden diese Inhalte in der Botschaft gemultiplext. Dieses Signal gibt den aktuellen Multiplex-Identifier an.
Der maximal mögliche Wert ist dem Signal "ST_DIAG_OBD_3_DRDY_MAX_MUX" zu entnehmen.

