LogicalInterface:BMW.INFRASTRUCTURE.VEHICLE.VehicleCondition[external]@Infrastruktur;
Dieses Signal gibt an, ob im aktuellen Fahrzeugzustand Kommunikation benötigt wird.
Über dieses Signal wird mitgeteilt, ob im aktuell aktiven Fahrzeugzustand ("Parken, Wohnen, Fahren", s. Signal ST_CON_VEH) Kommunikation benötigt wird. Dieses Signal definiert dadurch ein sogenanntes Basisteilnetz. Es dient dazu, festzulegen, welche Signale und Nachrichten im jeweiligen Basisteilnetz verfügbar sind. Der Teilnetzdomänenmaster (s. LH Teilnetzbetrieb Domänenmaster und Slave, 100003564) empfängt dieses Signal und befüllt aufgrund des Signalinhalts seine Netzwerkmanagement-Nachricht (Signal CTR_BS_PRTNT_NM). Über diese werden dann die Komponenten gesteuert, die das AUTOSAR Netzwerkmanagement unterstützen. Andere Komponenten (beispielsweise Komponenten an Klemme 15N oder MOST-Teilnehmer) werten dieses Signal selbst aus und steuern damit ihre Kommunikation.

LogicalInterface:BMW.INFRASTRUCTURE.VEHICLE.VehicleCondition[external]@Infrastruktur;
Dieses Signal gibt an, welche funktionalen Teilnetze aktiv sind.
Über dieses Signal wird mitgeteilt, welche funktionalen Teilnetze (z.B. "Entertainment", "Laden") aktiv sind. Es dient dazu, festzulegen, welche Signale und Nachrichten im jeweiligen funktionalen Teilnetz verfügbar sind. Der Teilnetzdomänenmaster (s. LH Teilnetzbetrieb Domänenmaster und Slave, 100003564) empfängt dieses Signal und befüllt aufgrund des Signalinhalts seine Netzwerkmanagement-Nachricht (Signal CTR_FKTN_PRTNT_NM). Über diese werden dann die Komponenten gesteuert, die das AUTOSAR Netzwerkmanagement unterstützen. Andere Komponenten (beispielsweise Komponenten an Klemme 15N oder MOST-Teilnehmer) werten dieses Signal selbst aus und steuern damit ihre Kommunikation.

LogicalInterface:BMW.INFRASTRUCTURE.VEHICLE.VehicleCondition[external]@Infrastruktur;
Das Signal Status_Zustand_Fahrzeug beschreibt den Fahrzeugzustand (Lastenheft "Parken, Wohnen, Fahren", 10000924) aus Kundensicht. Anhand dieses Zustandes wird festgelegt, welche (Kunden-)Funktionen aktuell verfügbar sein sollen.
Die Aktivbedingung für die einzelnen Funktionen sind der E/E-Funktionsliste zu entnehmen.

LogicalInterface:BMW.DASS.CRASH.ControlStatusPreCrash[external]@FASuS;
Dieses Signal teilt der Pre-Crash-Steuerung im ACSM mit, wie die Soll-Einstellung der Grenzbereichsunterstützung durch das DSC ist.
Dieses Signal wird von der DME1 AUSSCHLIESSLICH in M-Fahrzeugen empfangen.

